import {
	Box,
	Table,
	TableBody,
	TableCell,
	TableContainer,
	TableHead,
	TableRow,
} from '@mui/material';
import { useEffect, useState } from 'react';

export const App = () => {
	const [data, setData] = useState(null);

	const getData = () => {
		fetch('/data')
			.then((newData) => newData.json())
			.then((d) => {
				console.log(d.data);
				setData(d.data);
			});
	};
	useEffect(() => {
		getData();
	}, []);
	return (
		<Box
			style={{
				width: '100vw',
				minHeight: '100vh',
				display: 'flex',
				flexDirection: 'column',
				alignItems: 'center',
				justify: 'center',
			}}
		>
			<div style={{ position: 'absolute', top: '5vh' }}>S&P 500 Index Data</div>
			{data && <DataTable data={data} />}
		</Box>
	);
};

const DataTable = ({ data }) => {
	let sym = ['Symbol'];
	const columns = sym.concat(Object.keys(data[0][1]));

	const renderRows = () => {
		return data.map((row) => {
			return (
				<TableRow style={{height:100}}>
					<TableCell >{row[0]}</TableCell>
					{columns.slice(1, columns.length).map((c, idx) => {
						return (
							<TableCell style={{ height: 100, background:'pink' }} key={idx}>
								{row[1][c]}
							</TableCell>
						);
					})}
				</TableRow>
			);
		});
	};

	const renderHeader = () => {
		return columns.map((c, idx) => {
			return <TableCell key={idx}>{c}</TableCell>;
		});
	};
	return (
		<TableContainer
			style={{ width: '80vw', height: '70vh', marginTop: '10vh' }}
		>
			<Table stickyHeader>
				<TableHead>
					<TableRow>{renderHeader()}</TableRow>
				</TableHead>

				<TableBody>{renderRows()}</TableBody>
			</Table>
		</TableContainer>
	);
};
